import './App.css';
import ChatBot from 'react-simple-chatbot';
import logo from './invstr-logo.png'

const steps = [
  {
    id: '0',
    message: 'Welcome to react chatbot!',
    trigger: '1',
  },
  {
    id: '1',
    message: 'Bye!',
    end: true,
  },
];


function App() {
  return (
    <div style={{backgroundColor:"blue"}}>
      <img style={{width:'100%'}} src={logo}/>
    </div>
  );
}

export default App;
